import React from "react";
import "./App.css";
import { Button } from "@chakra-ui/react";

function App() {
  return (
    <div className="App">
      <header className="App-header"></header>
      <h1>Meditation-Timer</h1>
      <div className="header">
        <div className="button-left">
          <Button colorScheme="blue">Breathe in</Button>
        </div>

        <Button colorScheme="blue">Breathe out </Button>
      </div>
    </div>
  );
}

export default App;
